import { Route, Switch } from 'react-router-dom' // importing the Route and Switch components

// importing the pages so that we can display them on different routes

import AllQuotes from './pages/AllQuotes'; 
import NewQuote from './pages/NewQuote';
import QuoteDetail from './pages/QuoteDetails';

function App() {
  return ( // using the switch and Route components to make sure that only one path is hit at a time  
    <Switch>
      <Route path="/quotes">
        <AllQuotes />
      </Route>
      <Route path="/quotes/:quoteId">
        <NewQuote />
      </Route>
      <Route path="/new-quote">
        <QuoteDetail />
      </Route>
    </Switch>
  );
}

export default App;
